import ReactDOM from 'react-dom/client';
import App from './App';
import MyName from './my_name';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <MyName />
  </React.StrictMode>
);
